iente\nMANIFIESTA LA DENUNCIANTE QUE LE ROBAN DINERO DICIENDOLE QUE LOS AYUDARA PAR COBRAR UN BILLETE DE LOTERIA","Robo a cuentahabiente\nREFIERE LA QUERELLANTE QUE AL IR CAMINANDO LA INTERCEPTA UN MASCULINO QUIEN LA AGREDE FSICAMENTE Y LE ARREBATA SU BOLSA DE MANO Y SE DA A LA FUGA.","Robo a cuentahabiente\nREFIERE LA DENUNCIANTE QUE SUJETOS ARMADOS LA DESAPODERAN DE LA CANTIDAD DE $35,000 PESOS QUE ACABA DE RETIRAR EN EL BANCO","Robo a cuentahabiente\nSE PRESENTA POLICIA PREVENTYIVA A FIN DE PONER A DISPOSICION A UNA PERSONA DEL SEXO MASCULINO EL CUAL ES SEALADO POR LA VICTIMA COMO QUIEN MOMENTOS ANTES LO HABIA DESAPODERADO DE DINERO EN EFECTIVO QUE RETIRO MOMENTOS ANTES DEL CAJERO AUTOMATICO DEL BANCO BBVA. (DINERO CONSTANTE EN 1, 000.00 MIL PESOS MONEDA NACIONAL 00/100)","Robo a cuentahabiente\nLA QUERELLANTE REFIERE QUE AL SALIR DEL CAJERO LES ROBARON LA CANTIDAD DE $9,300.00 Y UN CELULAR.","Robo a cuentahabiente\nREFIERE EL DENUNCIANTE QUE AL IR CAMINANDO POR EL LUGAR DE LOS HECHOS, DESPUES DE SALIR DEL CAJERO AUTOMATICO DE BANCOMER DE RETIRAR DINERO, LO INTERCEPTAN DOS SUJETOS EN MOTOCICLETA, SE BAJAN LE COLOCAN ALGO EN LA ESPALDA Y LO DESAPODERAN DE SU CARTERA Y CELULAR, DANDOSE A LA FUGA","Robo a cuentahabiente\nREFIERE EL DENUNCIANTE QUE LE SUSTRAEN DIVERSOS OBJETOS DE SU CHAMARRA","Robo a cuentahabiente\nREFIERE LA DENUNCIANTE QUE AL IR CAMINANDO SOBRE DICHAS CALLES UN SUJETO LA DESAPODERA DE SU BOLSA EN LA CUAL TRAIA DINERO, SIENDO LA CANTIDAD DE $37,000.00 DEL CUAL IBA A REALIZAR UN PAGO DE UN TERRENO.","Robo a cuentahabiente\nREFIERE EL AGRAVIADO QUE AL IR CAMINANDO DOS SUJETOS LO DESEPODERAN DE SU MOCHILA EN LA CUAL TRAIA LA CANTIDAD DE $18,900.00 PESOS","Robo a cuentahabiente\nPRESENTA DENUNCIA POR ROBO DE DINERO","Robo a cuentahabiente\nREFIERE EL DENUNCIANTE QUE DOS SUJETOS PORTANDO ARMA DE FUEGO LO DESAPODERAN DE SUS PERTENENCIAS ASI COMO DEL DINERO QUE MOMENTOS ANTES HABIA RETIRADO DE UNA SUCURSAL BANCARIA","Robo a cuentahabiente\nREFIERE LA DENU
